INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FC', 'STOCK', 'Franklin Covey Co.', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Franklin Covey Co. is a global content and solutions company focused on individual and organizational performance improvement. The Company provides professional services in 150 countries and territories around the world. Its segments include North America, International Direct Offices, International Licenses, Education Practice, and Corporate and Other. The North America segment offers organizations to solve the problems that require changes in human behavior, including leadership, productivity, execution, trust, and sales performance. This segment includes sales personnel and operations that serve the United States and Canada. The International Licensees segment is primarily comprised of its international licensees royalty revenues. The Education Practice segment includes its domestic and international education practice operations. The Corporate and other information includes leasing operations, shipping and handling revenues, royalty revenues from Franklin Planner Corp.', 'Salt Lake City, UT, United States', 1084);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CQP', 'STOCK', 'Cheniere Energy Partners, L.P.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Cheniere Energy Partners, L.P., through its subsidiaries, provides liquefied natural gas (LNG) to integrated energy companies, utilities, and energy trading companies in the United States and internationally. The company owns and operates natural gas liquefaction and export facility at the Sabine Pass LNG Terminal located in Cameron Parish, Louisiana. It also owns a natural gas supply pipeline that interconnects the Sabine Pass LNG terminal with various interstate and intrastate pipelines. Cheniere Energy Partners, L.P. was founded in 2003 and is headquartered in Houston, Texas. Cheniere Energy Partners, L.P. is a subsidiary of Cheniere Energy, Inc.', 'Houston, TX, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELBM', 'STOCK', 'Electra Battery Materials Corporation', 'NCM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Electra Battery Materials Corporation is a Canada-based company. It is in the business of producing battery materials for the electric vehicle supply chain. It is focused on building a supply of cobalt, nickel and recycled battery materials. Its segment includes refinery, exploration and evaluation assets, and corporate and other. In addition to establishing the cobalt sulfate refinery, it is engaged in nickel refining and battery recycling. Its growth projects include integrating black mass recycling at its existing refining complex, evaluating opportunities for cobalt production in Becancour, Quebec, and exploring nickel sulfate production potential in North America. Its refinery process provides automakers with a circular solution to recycle their batteries and to source new batteries for new electric vehicles. Its Iron Creek Project consists of mining patents and exploration claims over an area of 3,300 hectares covering the strike extent of strata hosting mineralization.', 'Toronto, ON, Canada', 23);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNS', 'STOCK', 'Cohen & Steers, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Cohen & Steers, Inc. is a holding company, which is engaged in global investment management. The Company is specialized in real assets and alternative income, including listed and private real estate, preferred securities, infrastructure, resource equities, commodities, as well as multi-strategy solutions. The Companys distribution network encompasses two channels, wealth and institutional. Its wealth channel includes registered investment advisers, wire houses, independent and regional broker dealers and bank trusts. Its institutional channel includes sovereign wealth funds, corporate plans, insurance companies and public funds, including defined benefit and defined contribution plans, as well as other financial institutions that access its investment management services directly or through consultants and other intermediaries. The Company manages three types of investment vehicles, such as open-end funds, institutional accounts, and closed end.', 'New York, NY, United States', 411);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COYA', 'STOCK', 'Coya Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Coya Therapeutics, Inc. is a clinical-stage biotechnology company, which is engaged in developing treatments focused on the biology and potential therapeutic advantages of regulatory T cells (Tregs) to target systemic inflammation and neuroinflammation. Its initial developmental programs are focused on neurodegenerative, chronic inflammatory, autoimmune, and metabolic diseases of high unmet medical need. Its diversified candidate pipeline includes both ex vivo and in vivo approaches. Its product candidate pipeline is based on its three therapeutic modalities. The product candidates utilizing its Treg-enhancing biologics are collectively referred to as the 300 Series. The product candidates utilizing its Treg-derived exosomes are collectively referred to as the 200 Series. The product candidates utilizing its autologous Treg cell therapy are collectively referred to as the 100 Series. The Company''s 300 Series product candidates include COYA 301 and COYA 302.', 'Houston, TX, United States', 8);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VERB', 'STOCK', 'Verb Technology Company, Inc.', 'NCM', 'Technology', 'Software - Application', 'Verb Technology Company, Inc. focuses on social commerce, social telehealth and social crowdfunding with MARKET.live, VANITYPrescribed, GoodGirlRx and the GO FUND YOURSELF TV Show. MARKET.live specializes in livestream and artificial intelligence (AI)-powered social commerce. MARKET.live platform is a multi-vendor, livestream social shopping destination at the forefront of the convergence of e-commerce and entertainment, where brands, retailers, creators, and influencers engage their customers, clients, fans, and followers across multiple social media channels simultaneously. GO FUND YOURSELF is an interactive social crowd funding platform and TV show for public and private companies seeking broad-based exposure across social media channels for their crowd-funded Regulation CF and Regulation A offerings. VANITYPrescribed.com and GoodGirlRx.com are telehealth portals. GoodGirlRx.com offers customers access to telehealth services and pharmaceuticals (including the new weight-loss drugs).', 'Las Vegas, NV, United States', 18);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COMT', 'STOCK', 'iShares GSCI Commodity Dynamic Roll Strategy ETF', 'NGM', NULL, NULL, 'The index measures the performance of futures contracts. In seeking to achieve its investment objective, the fund may invest in a combination of exchange-traded commodity futures contracts, exchange-traded options on commodity-related futures contracts and exchange-cleared commodity related swaps (together, “Commodity-Linked Investments”), thereby obtaining exposure to the commodities markets.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVK', 'STOCK', 'Advent Convertible and Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Advent Claymore Convertible Securities and Income Fund is a closed-ended fixed income mutual fund launched and managed by Advent Capital Management, LLC. The fund primarily invests in the fixed income markets of the United States. It seeks to invest in securities of companies operating across the diversified sectors. The fund invests approximately 60% of its portfolio in convertible securities and rest in lower-grade non-convertible income securities. It employs fundamental analysis to create its portfolio. Advent Claymore Convertible Securities and Income Fund was formed on April 29, 2003 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGNG', 'STOCK', 'Global X Aging Population ETF', 'NGM', NULL, NULL, 'The fund invests more than 80% of its total assets in the securities of the underlying index. The underlying index is designed to provide exposure to exchange-listed companies in developed markets that facilitate the demographic trend of longer average life spans and the aging of the global population, including but not limited to companies involved in biotechnology, medical devices, pharmaceuticals, senior living facilities and specialized health care services.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCO', 'STOCK', 'Ducommun Incorporated', 'NYQ', 'Industrials', 'Aerospace & Defense', 'Ducommun Incorporated provides value-added manufacturing solutions to customers in the aerospace, defense and industrial markets. It specializes in two core areas-Electronic Systems and Structural Systems to produce complex products and components for commercial aircraft platforms, mission-critical military and space programs, and sophisticated industrial applications. Electronic Systems designs, engineers and manufactures high-reliability electronic and electromechanical products used in worldwide technology-driven markets, including aerospace and defense and industrial end-use markets. Electronic Systems product offerings primarily range from prototype development to complex assemblies. Structural Systems designs, engineers and manufactures large, complex contoured aerostructure components and assemblies and supplies composite and metal bonded structures and assemblies. Structural Systems products are primarily used on commercial aircraft, military fixed-wing aircraft, and others.', 'Costa Mesa, CA, United States', 2180);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDT', 'STOCK', 'CDT Equity Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Conduit Pharmaceuticals, Inc. is a multi-asset clinical-stage, life science company. The Company facilitates the development and commercialization of clinical assets. The Company acquires and funds the development of Phase 2-ready assets, builds an integrated and advanced platform-driven approach powered by artificial intelligence (AI) and cybernetics, and seeks exit through third-party license deals following successful clinical trials. The Companys asset pipeline includes AZD1656 (a Glucokinase Activator), AZD5658 (Glucokinase Activator), and AZD5904 (a Myeloperoxidase Inhibitor). AZD1656 is a glucokinase activator used in diabetes mellitus. It is used as a treatment option for Hashimotos Thyroiditis. AZD5904 includes a potent, irreversible inhibitor of human myeloperoxidase (MPO), for the treatment, prevention, and prophylaxis of idiopathic male infertility.', 'Naples, FL, United States', 6);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUID', 'STOCK', 'authID Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'authID Inc. is a provider of biometric identity verification and authentication solutions. The Company enables enterprises Know Whos Behind the Device for every customer or employee login and transaction. Through its integrated, patented, biometric identity platform, the Company verifies a users identity, eliminating any assumption of who is behind a device and preventing cybercriminals from taking over accounts. The Company combines digital onboarding, biometric passwordless authentication and account recovery, with a fast, accurate, user-friendly experience delivering identity verification in 700ms. Its cloud-based platform offers services such as Biometric Identity Verification-Proof, Biometric Identity Authentication-Verified, PrivacyKey Privacy Preserving Biometrics, and Account/Access Recovery. Biometric identity verification establishes the trusted identity of users based on a variety of ground truth sources, including government-issued identity documents.', 'Denver, CO, United States', 46);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPZ', 'STOCK', 'Calamos Long/Short Equity & Dynamic Income Term Trust', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Long/Short Equity & Dynamic Income Trust (the Fund) is a diversified, closed-end management investment company. The Fund''s investment objective is to seek current income and risk-managed capital appreciation. The Fund is focused on investing 80% of its managed assets in a globally diversified portfolio comprised of equity securities, which include common stock, preferred stock, convertible securities, and exchange-traded funds (ETFs), as well as long and short equity positions managed pursuant to a long/short equity strategy. The Fund may invest its managed assets in globally diversified income-producing securities, including high-yield and investment grade corporate securities, leveraged loans, distressed debt securities, securitized products, United States (US) treasuries and sovereign debt issued by foreign governments. The Fund may invest up to 50% of its managed assets in securities of foreign issuers. The Funds investment advisor is Calamos Advisors LLC.', 'Naperville, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTSGU', 'STOCK', 'BrightSpring Health Services, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'BrightSpring Health Services, Inc. operates as a home and community-based healthcare services platform in the United States. It operates through two segments, Pharmacy Solutions and Provider Services. The company''s platform focuses on delivering pharmacy and provider services, including clinical and supportive care in home and community settings to Medicare, Medicaid, and insured populations. It also offers infused, injectable, and oral medication services; and patient-centric, highly skilled, and compassionate clinical home health care, as well as rehabilitation services, including physical, speech and occupational therapy and applied behavioral analysis. The company was formerly known as Phoenix Parent Holdings Inc. and changed its name to BrightSpring Health Services, Inc. in May 2021. BrightSpring Health Services, Inc. was founded in 1974 and is headquartered in Louisville, Kentucky.', 'Louisville, KY, United States', 37000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTGO', 'STOCK', 'Contango Ore, Inc.', 'ASE', 'Basic Materials', 'Gold', 'Contango ORE, Inc. is engaged in the exploration of gold and associated minerals in Alaska. The Company holds a 30% interest in the Peak Gold JV, which leases approximately 675,000 acres of land for exploration and development on the Manh Choh project, with the remaining 70% owned by KG Mining (Alaska), Inc., an indirect subsidiary of Kinross Gold Corporation, operator of the Peak Gold JV. It also has a lease on the Johnson Tract project from the underlying owner, CIRI Native Corporation, a lease on Lucky Shot project from the underlying owner, Alaska Hardrock Inc. and through its subsidiary has 100% ownership of approximately 8,600 acres of peripheral State of Alaska mining claims. It also owns a 100% interest in an additional approximately 145,000 acres of State of Alaska mining claims through its wholly owned subsidiary, which gives the Company an exclusive right to explore and develop minerals on these lands. The Company also owns Golden Zone and Amanita NE gold properties.', 'Fairbanks, AK, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUXX', 'STOCK', 'Strive Enhanced Income Short Maturity ETF', 'NYQ', NULL, NULL, 'The fund is an actively-managed exchange-traded fund (“ETF”) that, using an enhanced cash strategy, seeks to achieve its investment objective, under normal circumstances, by investing at least 80% of its net assets in U.S.-dollar denominated investment-grade fixed- and floating-rate bonds, and debt securities. Under normal circumstances, the fund will seek to maintain a dollar-weighted average maturity of less than two years and a dollar-weighted average duration of less than one year. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHSCO', 'STOCK', 'CHS Inc.', 'NMS', 'Consumer Defensive', 'Farm Products', 'CHS Inc. is an integrated agricultural company, which provides grain, food, agronomy and energy resources to businesses and consumers on a global basis. It provides a variety of products and services, ranging from initial agricultural inputs such as fuels, farm supplies, crop nutrients and crop protection products to agricultural outputs that include grain and oilseed, processed grain and oilseed, renewable fuels and food products. It operates through three segments: Energy, Ag and Nitrogen Production. Its Energy segment produces and sells (primarily wholesale) gasoline, diesel fuel, propane, asphalt, lubricants and other related products, and also provides transportation services. Its Ag segment includes global grain and processing, ag retail and wholesale agronomy businesses. Its Nitrogen Production segment consists of its equity method investment in CF Industries Nitrogen, LLC (CF Nitrogen), which produces nitrogen-based products, including methanol, UAN, urea and related products.', 'Inver Grove Heights, MN, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAC', 'STOCK', 'Camden National Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'Camden National Corporation is a bank holding company for Camden National Bank (the Bank). The business of the Company is to attract deposits from and to extend loans to consumer, institutional, municipal, non-profit and commercial customers. The Company, through the Bank, provides a range of banking and other financial services, including wealth management and trust services, brokerage, investment advisory and insurance services to consumer, business, non-profit and municipal customers. The Banks digital products enable customers to bank anywhere at any time, including, but not limited to, online and mobile banking, which includes MortgageTouch, its easy-to-use online platform for consumer borrowers; BusinessTouch, its online loan application system with instant approval, making borrowing faster and easier for small businesses, and TreasuryLink, its secure online platform designed to offer advanced cash management, monitoring capabilities and controls for commercial customers.', 'Camden, ME, United States', 586);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACGLN', 'STOCK', 'Arch Capital Group Ltd.', 'NMS', 'Financial Services', 'Insurance - Diversified', 'Arch Capital Group Ltd. is a Bermuda-based company, which provides insurance, reinsurance and mortgage insurance through its subsidiaries. The insurance segment consists of the Companys insurance underwriting units, which offer specialty product lines, including construction and national accounts; excess and surplus casualty; professional lines; programs; property, energy, marine and aviation; travel, accident and health; warranty and lenders solutions, and others (consisting of alternative markets, excess workers'' compensation and surety business). The reinsurance segment consists of its reinsurance underwriting units, which offer specialty product lines, including casualty; marine and aviation; other specialty; property catastrophe; property excluding property catastrophe, and other (consisting of life reinsurance and other). The mortgage segment includes its United States primary mortgage insurance business, investment and services related to United States credit-risk transfer.', 'Pembroke, , Bermuda', 7200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMRN', 'STOCK', 'Amarin Corporation plc', 'NCM', 'Healthcare', 'Drug Manufacturers - General', 'Amarin Corporation PLC is a pharmaceutical company. The Company is focused on the commercialization and development of therapeutics to improve cardiovascular (CV), health and reduce CV risk. The Company operates through the development and commercialization of VASCEPA. Its lead product, Vascepa (icosapent ethyl) capsule is used as an adjunct to diet to reduce triglyceride levels in adult patients with severe hypertriglyceridemia. This indication for Vascepa, known as the MARINE indication, is based primarily on the results from the MARINE study of Vascepa in this approved patient population. The Company sells Vascepa principally to wholesalers, as well as selected regional wholesalers and specialty pharmacy providers, or collectively, its distributors, which in turn resell Vascepa to retail pharmacies for resale to patients and healthcare providers.', 'Dublin 2, , Ireland', 275);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NVNO', 'STOCK', 'enVVeno Medical Corporation', 'NCM', 'Healthcare', 'Medical Devices', 'enVVeno Medical Corporation is a late clinical-stage medical device company. The Company is focused on the advancement of bioprosthetic (tissue-based) solutions to improve the standard of care for the treatment of venous disease. The Company is developing surgical and non-surgical replacement venous valves for patients suffering from severe chronic venous insufficiency (CVI) of the deep venous system of the leg. The Companys lead product is the VenoValve, which is a surgical replacement venous valve that is being evaluated in a U.S. pivotal study. The VenoValve is implanted into the femoral vein of the patient in an open surgical procedure via a 5-to-6-inch incision in the upper thigh. The Company is also developing a second product called enVVe, which is a non-surgical, transcatheter-based replacement venous valve. Both the VenoValve and enVVe are designed to act as one-way valves, to help assist in propelling blood up the veins of the leg, and back to the heart and lungs.', 'Irvine, CA, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VELXQ', 'STOCK', 'Canadian Overseas Petroleum Limited', 'OEM', 'Energy', 'Oil & Gas E&P', 'Canadian Overseas Petroleum Limited is a Canada-based international oil and gas exploration, development and production company. The Company and its subsidiaries are involved in the identification, acquisition, exploration, development and production of oil and natural gas reserves and hold interests in petroleum assets focused on the United States of America. The Company is engaged in pursuing opportunities in the United States with operations in Wyoming. The Company''s assets are located in the Powder River Basin, Wyoming, United States, which include an oil exploration unit consisting of a 96.1% working interest in the Cole Creek area (CCU) as well as an 85.7% working interest in a secondary recovery unit for the Shannon formation in the Barron Flats area (BFSU) and other non-unitized lands complimentary to the assets.', 'Calgary, AB, Canada', 23);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHT', 'STOCK', 'Chunghwa Telecom Co., Ltd.', 'NYQ', 'Communication Services', 'Telecom Services', 'A Chunghwa Telecom Co Ltd é uma empresa sediada em Taiwan que atua principalmente na prestação de serviços de telecomunicações. A Companhia realiza comunicações fixas domésticas, comunicações móveis, Internet e serviços internacionais de comunicações fixas. A Empresa presta serviços domésticos de comunicação fixa para o mercado doméstico, incluindo redes inteligentes telefônicas locais e de longa distância. Serviços de aluguer de circuitos domésticos, incluindo serviços de linha de assinante digital assimétrica (ADSL), serviços de geração ótica. Internet e serviços de valor agregado, incluindo provedores de serviços de Internet (ISP), serviços de valor agregado. Serviços multimédia a pedido (MOD) e Internet Protocol Television (IPTV), serviços internacionais de comunicação fixa. A empresa fornece serviços de integração de clientes empresariais, serviços de clientes empresariais móveis, serviços de clientes empresariais de dados, entre outros.', 'Taipei, , Taiwan', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCD', 'STOCK', 'Calamos Dynamic Convertible and Income Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Dynamic Convertible and Income Fund is a closed ended fixed income mutual fund launched by Calamos Investments LLC. It is managed by Calamos Advisors LLC. The fund invests in the fixed income markets of the United States. It primarily invests in a portfolio of convertible securities, investment grade and below investment grade bonds, loans, equity-linked notes, and floating rate securities. The fund also invests through derivatives such as options. It employs fundamental analysis with a top-down global macroeconomic approach to create its portfolio. Calamos Dynamic Convertible and Income Fund was formed on March 11, 2014 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNY', 'STOCK', 'BlackRock New York Municipal Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock New York Municipal Income Trust is a closed ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in fixed income markets. It invests primarily in the investment grade municipal bonds exempt from federal income taxes and New York State and New York City personal income taxes. BlackRock New York Municipal Income Trust was formed on July 26, 2001 and is domiciled in United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHE', 'STOCK', 'Chemed Corporation', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Chemed Corporation is engaged in purchasing, operating, and divesting subsidiaries in diverse business activities. The Company''s segment includes VITAS and the Roto-Rooter. The VITAS segment provides hospice and palliative care services to its patients through a network of physicians, registered nurses, home health aides, social workers, clergy and volunteers. It provides direct medical services to patients, as well as spiritual and emotional counseling to both patients and their families. The Roto-Rooter segment provides plumbing, drain cleaning, excavation, water restoration and other related services to residential and commercial customers. The Roto-Rooter services are provided through a network of Company-owned branches, independent contractors and franchisees. The Company''s water restoration services involve the remediation of water and humidity after a flood and are provided to both commercial and residential customers.', 'Cincinnati, OH, United States', 15695);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGMC', 'STOCK', 'FG Merger II Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'FG Merger II Corp. is a blank check company. The Company is formed for the purpose of effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization or similar business combination with one or more businesses. The Company has not selected any specific business combination target and has not, nor has anyone on its behalf, initiated any substantive discussions, directly or indirectly, with any business combination target. It intends to focus on businesses in the financial services industry. The Company neither engaged in any operations nor generated any revenue.', 'Itasca, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXLG', 'STOCK', 'Destination XL Group, Inc.', 'NGM', 'Consumer Cyclical', 'Apparel Retail', 'Destination XL Group, Inc. is a specialty retailer of big + tall mens apparel with retail locations throughout the United States. It operates under the trade names of Destination XL, DXL, DXL Men''s Apparel, DXL outlets, DXL Big + Tall, Casual Male XL, and Casual Male XL outlets. It operates approximately 247 DXL retail stores, 15 DXL outlet stores, 7 Casual Male XL retail stores, 19 Casual Male XL outlet stores, and a digital business. Its DXL retail stores, e-commerce site, and mobile application offers its customers merchandise to fit a variety of lifestyles from casual to business, young to mature, in all price ranges and in all large sizes from XL and up. In addition, it also offers a selection of shoes in sizes 10W to 18W on its websites. Its Casual Male XL retail stores primarily carry moderate-priced national brands and its own brands of casual sportswear and dresswear. It also operates Casual Male XL outlets and DXL outlets for its customers.', 'Canton, MA, United States', 1447);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKN', 'STOCK', 'BlackRock Investment Quality Municipal Trust Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Investment Quality Municipal Trust Inc. is a closed ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in fixed income markets. It invests primarily in investment grade municipal bonds municipal obligations exempt from federal income taxes. Blackrock Investment Quality Municipal Trust Inc. was formed on February 28, 1993 and is domiciled in United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESAB', 'STOCK', 'ESAB Corporation', 'NYQ', 'Industrials', 'Metal Fabrication', 'ESAB Corporation is a focused premier industrial compounder. The Company provides its partners with fabrication technology advanced equipment, consumables, gas control equipment, robotics and digital solutions. Its segments include Americas and EMEA & APAC. The Americas segment includes operations in North America and South America. The EMEA & APAC segment which includes Europe, Middle East, India, Africa, and Asia Pacific. The Companys products are utilized to solve challenges in a range of industries, including cutting, joining and automated welding. Its products are marketed under various brand names, such as ESAB, providing a range of products with technologies to solve challenges in virtually any industry. It serves a global customer base across multiple markets through a combination of direct sales and third-party distribution channels. Its customer base is diversified in the industrial end markets. It serves customers in approximately 150 countries.', 'North Bethesda, MD, United States', 8000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AYRO', 'STOCK', 'Ayro, Inc.', 'NCM', 'Consumer Cyclical', 'Auto Manufacturers', 'AYRO, Inc. designs and manufactures compact, sustainable electric vehicles for closed-campus mobility, low-speed urban and community transport, local on-demand and last-mile delivery and government use. Its four-wheeled, purpose-built electric vehicles are geared toward commercial customers, including universities, business and medical campuses, last-mile delivery services and food service providers. Its vehicles provide the end user with an environmentally friendly alternative to internal combustion engine vehicles, for light-duty uses, including low-speed logistics, maintenance services, cargo services, and personal/group transport in a quiet, and zero-emissions vehicle. Its vehicles include AYRO Vanish, and AYRO Valet. The AYRO Vanish is a utility low-speed electric vehicle (LSEV) with a lightweight architecture to limit vehicle weight and maximize payload capacity. The AYRO Valet, a people mover, is a six-seat LSEV built to transport the patrons, team, or visitors in style.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMST', 'STOCK', 'Amesite Inc.', 'NCM', 'Technology', 'Software - Application', 'Amesite Inc. is a technology company. The Company is specialized in the development and marketing of business-to-consumer (B2C) and business-to-business (B2B) artificial intelligence (AI)-driven solutions, including its higher ed platform that offers professional learning. It has products in two sectors: Higher Education and Healthcare. It offers cutting-edge applications that cater to both individual and professional needs. The Companys NurseMagic is a mobile app for healthcare professionals, streamlines creation of nursing notes and documentation tasks, enhances patient communication, and offers personalized guidance to nurses on patient care, medications, and handling challenging workplace situations. NurseMagic is designed for use across various healthcare modalities, such as skilled nursing, assisted living, memory care, home health, and rehabilitation centers.', 'Detroit, MI, United States', 9);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACOG', 'STOCK', 'Alpha Cognition Inc. Common Stock', 'NCM', 'Healthcare', 'Biotechnology', 'Alpha Cognition Inc. is a commercial stage, biopharmaceutical company dedicated to developing treatments for patients suffering from neurodegenerative diseases, such as Alzheimers disease and Cognitive Impairment with mild Traumatic Brain Injury (mTBI). The Company''s ZUNVEYL (benzgalantamine) product is a delayed release oral tablet formulation indicated for the treatment of mild to moderate dementia of the Alzheimers type in adults. Its pre-clinical development programs include ZUNVEYL in combination with memantine for the treatment of moderate-to-severe Alzheimers disease; ALPHA-1062 sublingual formulation; ALPHA-1062 intranasal formulation for the treatment of cognitive impairment with mTBI; ALPHA-0602; ALPHA-0702 & ALPHA-0802 (Progranulin and Progranulin GEMs) for the treatment of neurodegenerative diseases including amyotrophic lateral sclerosis or Lou Gehrigs disease and spinal muscular atrophy, and ALPHA-1062 for the treatment of acute pancreatitis.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DORM', 'STOCK', 'Dorman Products, Inc.', 'NMS', 'Consumer Cyclical', 'Auto Parts', 'Dorman Products, Inc. is a supplier of replacement and upgrade parts in the motor vehicle aftermarket industry, serving passenger cars, light, medium, and heavy-duty trucks, as well as specialty vehicles, including utility terrain vehicles and all-terrain vehicles. Its segments include Light Duty, Heavy Duty, and Specialty Vehicle. The Light Duty segment designs and markets replacement parts and fasteners primarily for passenger cars and light trucks with sales to retailers and wholesale distributors who primarily serve passenger car and light truck customers. The Heavy Duty segment designs and markets replacement parts primarily for medium and heavy trucks with sales to independent distributors, independent component specialists and rebuilders, and auto parts stores that focus on the heavy-duty market. Specialty Vehicle segment designs, markets, and manufactures aftermarket parts and accessories for the powersports market with sales through direct-to-consumer, dealers, and installers.', 'Colmar, PA, United States', 3787);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGH', 'STOCK', 'Barings Global Short Duration High Yield Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Babson Capital Global Short Duration High Yield Fund is a closed ended fixed income mutual fund launched and managed by Barings LLC. The fund is co-managed by Babson Capital Global Advisors Limited. It invests in fixed income markets across the globe. The fund primarily invests in global high-yield bonds, loans, and other income-producing instruments that are, at the time of purchase, rated below Baa3 by Moody''s Investors Service, Inc. or below BBB- by Standard & Poor''s Rating Services. It seeks to invest in securities with a weighted average portfolio duration of three years or less. The fund employs bottom-up fundamental analysis to create its portfolio. It benchmarks the performance of its portfolio against the Bank of America/Merrill Lynch Global Non-Financial High Yield Constrained Index. The fund was formerly known as Babson Capital Global Short Duration High Yield Fund. Babson Capital Global Short Duration High Yield Fund was formed on October 25, 2012 and is domiciled in the ', 'Charlotte, NC, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGCB', 'STOCK', 'Dimensional Global Credit ETF', 'NGM', NULL, NULL, 'The fund seeks to maximize total returns primarily from a universe of U.S. and foreign corporate debt securities that mature within twenty years from the date of settlement. The Portfolio generally emphasizes investments in debt securities rated A+ to BBB- by S&P or Fitch or A1 to Baa3 by Moody’s. The Portfolio may also invest in higher-rated investment grade securities and/or below-investment grade securities depending on the expected credit premium.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOKF', 'STOCK', 'BOK Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'BOK Financial Corporation is a financial holding company. Through its subsidiaries, the Company provides commercial and consumer banking, brokerage trading, investment and trust services, mortgage origination and servicing, and an electronic funds transfer network. Its holdings include BOKF, NA; BOK Financial Securities, Inc., and BOK Financial Private Wealth, Inc. It offers full-service banking in Oklahoma, Texas, New Mexico, Northwest Arkansas, Colorado, Arizona, and Kansas/Missouri. Its segments include Commercial Banking, Consumer Banking, and Wealth Management. Commercial Banking includes lending, treasury and cash management services, and customer commodity risk management products for small businesses, middle market, and larger commercial customers. Consumer Banking includes retail lending and deposit services, lending and deposit services to small business customers served through the retail branch network and all mortgage loan origination and servicing activities.', 'Tulsa, OK, United States', 5037);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FVR', 'STOCK', 'FrontView REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'FrontView REIT, Inc. is an internally managed net-lease real estate investment trust (REITs). The Company is engaged in acquiring, owning and managing outparcel properties that are net leased to a diversified group of tenants. It focuses on investing primarily in well-located, net-leased outparcel properties that provide high visibility to consumers. It owns a well-diversified portfolio of 307 outparcel properties across 35 United States. The Companys tenants include service-oriented businesses, such as restaurants, cellular stores, financial institutions, automotive stores and dealers, medical and dental providers, pharmacies, convenience and gas stores, car washes, home improvement stores, grocery stores, professional services as well as general retail tenants. Its tenant brands include Verizon, Oak Street Health, Adams Auto Group, Raising Canes, IHOP, Mammoth Car Wash, CVS, AT&T, Walgreens, Bank of America, Advance Auto Parts, Heartland Dental, and Burger King.', 'Dallas, TX, United States', 15);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGI', 'STOCK', 'Birks Group Inc.', 'ASE', 'Consumer Cyclical', 'Luxury Goods', 'Birks Group Inc. is a Canada-based designer of fine jewelry and an operator of luxury jewelry, timepieces and gifts retail stores in Canada. The Company operates through two segments: Retail and Other. Its Retail segment operates over 17 stores across Canada under the Maison Birks brand, one retail location in Montreal under the Birks brand, one retail location in Montreal under the TimeVallee brand, one retail location in Calgary under the Brinkhaus brand, one retail location in Vancouver under the Graff brand, one retail location in Vancouver under the Patek Philippe brand, and three retail locations in Laval, Ottawa and Toronto under the Breitling brand. Its Other segment consists primarily of the e-commerce business, wholesale business and gold exchange business. Its collections are available at Mappin & Webb and Goldsmiths in the United Kingdom, in addition to several jewelry retailers across North America.', 'Montreal, QC, Canada', 293);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALGS', 'STOCK', 'Aligos Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aligos Therapeutics, Inc. is a clinical-stage biotechnology company focused on developing novel therapeutics to address unmet medical needs in liver diseases and viral infections, including in the areas of chronic hepatitis B virus (HBV) infection, metabolic dysfunction-associated steatohepatitis (MASH), and coronavirus infections such as, SARS-Co-V2, SARS-CoV, MERS-CoV, and other related infections. Its pipeline of drug candidates includes ALG-000184 for chronic HBV infection, ALG-055009 for MASH, ALG-097558 for coronavirus infections, and a portfolio of preclinical programs. ALG-000184 is a potential Capsid Assembly Modulator (CAM-E) for chronic HBV infection with enhanced pharmacologic properties. In the area of chronic HBV infection, its advanced drug candidate, ALG-000184, helps in disrupting the HBV lifecycle with viral suppression as well as reductions in viral antigens. Its ALG-055009 is an oral, small-molecule thyroid receptor beta agonist (THR-?) for the treatment of MASH.', 'South San Francisco, CA, United States', 70);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGT', 'STOCK', 'BlackRock Floating Rate Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Floating Rate Income Trust is a close ended fixed income mutual fund launched by BlackRoack Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock Financial Management, Inc. It invests in the fixed income markets across the globe while focusing on the United States. The fund invests in bonds of companies operating across diversified sectors. It invests in corporate bonds with average effective duration of its portfolio will be no more than 1.5 years. The fund was formerly known as BlackRock Global Floating Rate Income Trust. BlackRock Floating Rate Income Trust was formed on August 30, 2004 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BOW', 'STOCK', 'Bowhead Specialty Holdings Inc.', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'Bowhead Specialty Holdings Inc. is an insurance holding company. The Company provides specialty property and casualty insurance products in the United States. It conducts its business operations through three wholly owned subsidiaries, such as Bowhead Specialty Underwriters, Inc. (BSUI), Bowhead Insurance Company, Inc. (BICI), and Bowhead Underwriting Services, Inc. (BUSI). Its Casualty division provides solutions on a primary and excess basis through a wholesale-only distribution channel. Its Professional Liability division provides underwriting solutions on both an admitted and excess and surplus (E&S) basis for standard and nonstandard risks and writes for a broad variety of entities, including publicly traded and privately held financial institutions as well as not-for-profit organizations. Its Healthcare division focuses solely on healthcare entities to provide tailored solutions. It offers Professional and General Liability coverage, as well as Management Liability coverage.', 'New York, NY, United States', 249);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTI', 'STOCK', 'Drilling Tools International Corporation', 'NCM', 'Energy', 'Oil & Gas Equipment & Services', 'Drilling Tools International Corp. is a global oilfield services company that manufactures and provides a differentiated, rental-focused offering of tools for use in onshore and offshore horizontal and directional drilling operations. The Company''s operating activities are divided into four divisions: Directional Tool Rentals, Premium Tools Division, Wellbore Optimization Tools, and Other Products & Services, including Downhole Inspection Solutions & Downhole Machining Solutions. Its primary products are bottom hole assembly components such as stabilizers, subs, non-magnetic and steel drill collars, hole openers, roller reamers, as well as drill pipe and drill pipe accessories. In addition, the Company provides technology in its wellbore optimization business supplying the patented Drill-N-Ream (trademark) wellbore conditioning tool, and the patented RotoSteer (trademark), rotational steering tool. The Company operates from over 16 service and support centers across North America.', 'Houston, TX, United States', 447);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALUR', 'STOCK', 'Allurion Technologies Inc.', 'NYQ', 'Healthcare', 'Medical Devices', 'Allurion Technologies, Inc. offers Allurion Program, which is a weight loss platform that combines the Allurion Gastric Balloon for weight loss. The Company offers Allurion Virtual Care Suite, including the Allurion Mobile App for consumers and Allurion Insights for healthcare providers featuring the Iris AI Platform, and the Allurion Connected Scale. The Allurion Balloon is swallowed as a capsule under the guidance of a healthcare provider without surgery, endoscopy, or anesthesia. The Allurion Balloon is a procedure-less intragastric balloon that does not require any surgery, endoscopy, or anesthesia for placement. The balloon is swallowed in a capsule during a discrete outpatient office visit that takes approximately 15 minutes (though times may vary across different outpatient offices). The Allurion Virtual Care Suite is a cutting-edge digital therapeutic that combines AI-powered remote patient monitoring tools with a behavior change program.', 'Natick, MA, United States', 134);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGNT', 'STOCK', 'Cognyte Software Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'Cognyte Software Ltd is an Israel-based company. The main activity is focused on providing security and analytics software. The Company designs software that empowers governments and enterprises with Actionable Intelligence for solutions accelerate security investigations to successfully identify, neutralize, and prevent threats.', 'Herzliya, , Israel', 1623);\n